<template>
  <text class="zui-icon"
        :class="'zui-icon-'+name"
        :style="{ color: color || '#999', fontSize: size + unit, fontWeight: bold ? 'bold' : 'normal',margin:margin }"
        @tap="handleClick">
  </text>
</template>

<script>
// import icons from './zui-icon.js';
// #ifdef APP-NVUE
var domModule = weex.requireModule('dom');
domModule.addRule('fontFace', {
  'fontFamily': 'zeerFont',
  "src":
      "url('data:font/ttf;charset=utf-8;base64,') format('truetype')"
});
// #endif
export default {
  name: 'zuiIcon',
  emits: ['click'],
  props: {
    name: {
      type: String,
      default: ''
    },
    size: {
      type: [Number, String],
      default: 32
    },
    //px或者rpx
    unit: {
      type: String,
      default: 'px'
    },
    color: {
      type: String,
      default: '#999'
    },
    bold: {
      type: Boolean,
      default: false
    },
    margin: {
      type: String,
      default: "0"
    },
    index: {
      type: Number,
      default: 0
    }
  },
  data() {
    return {
      // icons: icons
    }
  },
  methods: {
    handleClick() {
      this.$emit('click', {
        index: this.index
      });
    }
  }
};
</script>

<style scoped>
/* #ifndef APP-NVUE */
/* 头条小程序组件内不能引入字体，需要在父级页面引入字体文件*/
@font-face {
  font-family: "zeerFont"; /* Project id 4244565 */
  src: url('data:font/ttf;charset=utf-8;base64,') format('truetype');
}

/* #endif */

.zui-icon {
  font-family: zeerFont;
  text-align: center;
  text-decoration: none;
}
</style>
